function OfferSect({ imageSrc, imageAlt, heading, content }) {

    return (
        <>
            <div className={classes.offerSection}>
                <img src={imageSrc} alt="" className={classes.image}/>
                <h3>{heading}</h3>
                <p>{content}</p>
            </div>
        </>
    )
}

export default OfferSect;
